import React from 'react';
import {
    Typography,
    Avatar,
    Grid,
    Box
} from "@material-ui/core";
import Typed from "react-typed";
import avatar from "../profile-pic.jpg"

const Header = () => {
    return (
        <Box>
            <Avatar src={avatar} alt="Picture Profile" />
            <Typography variant="h4">
                <Typed strings={["Welcome to Mario Castro's Portfolio"]} typeSpeed={45} />
            </Typography>
            <br />
            <Typography variant="h5">
                <Typed strings={["Academic Researcher", "Translator", "Web Developer", "Teacher", ]} typeSpeed={45} />
            </Typography>
        </Box>
    );
};

export default Header
